&quot;Joseph Alfred Arner Burnquist (July 21, 1879 – January 12, 1961) was an American politician. He served in the Minnesota State Legislature from 1909–1911, was elected the 20th Lieutenant Governor of Minnesota in 1912, and then served as the 19th Governor of Minnesota from December 30, 1915 to January 5, 1921. He became Governor after the death of Governor Winfield Scott Hammond. He later served the state as Attorney General from January 2, 1939 until January 3, 1955. He was a Republican.&quot;
